import React from 'react';
import styled from 'styled-components';
import { Form } from 'react-bootstrap';

const FormLegend = styled.legend`
  // border: 1px solid #000;
  padding: 0 10px;
`;

const FormSubmit = ({ onSubmit }) => {
  return(
    <div>
      <fieldset>
        <FormLegend>Insert an item</FormLegend>
        <form onSubmit={onSubmit}>
          <Form.Group>
            <Form.Control as="number" name="time_spent" required />
            <Form.Control as="select" name="activity" required>
              <option disabled selected>Chose an activity</option>
              <option value="Run">Run</option>
              <option value="Swimming">Swimming</option>
              <option value="Bike">Bike</option>
            </Form.Control>
            <Form.Control as="date" name="date" required />
          </Form.Group>

          <button type="submit">Add</button>
        </form>
      </fieldset>
    </div>
  );
}

export default FormSubmit;
